  false,\n\t\"url\": null,\n\t\"notes\": \"This report is about an investigation that
  was done to determine the quantity and species of submergent vegetation in the marsh
  area on the Canvasback Gun Club in Nevada. During the month of August, 1962, an
  aquatic habitat investigation was conducted on the Canvasback Gun Club by Bureau
  of Sport Fisheries and Wildlife personnel. The purpose of this investigation was
  to determine the quantity and species of submergent vegetation on the area, and
  to compare these findings with data collected during similar surveys in 1960 and
  1961.  Most of the marsh area of the Club remains in a mature stage of marsh evolution
  which offers little of value to waterfowl. Only a few of the smaller, relatively
  u201cyoungu201d ponds are producing waterfowl food in appreciable quantities. Most
  of the marsh remains virtually barren of any submergent plant growth of value to
  waterfowl.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
